import React, { Component } from 'react';
import './navbar.css'

class Navbar extends Component {
    render() {
        return (
            <header className="navHeader">
                <nav className="nav">
                    <div>
                        <ul className="navLinks">
                            <li className="link"><a href='/'>Search 1</a></li>
                            <li className="link"><a href='/'>Search 2</a></li>
                            <li className="link"><a href='/'>Search 2</a></li>
                        </ul>
                    </div>
                </nav>
            </header>
        );
    }
}

export default Navbar;
